class Solution {
    public int findMaxConsecutiveOnes(int[] nums) {
        //输入合法性判断
        if (nums == null) {
            return 0;
        }

        //遍历数组，然后计数
        int num = 0;
        int j = 0;
        int[] ans = new int[nums.length];
        for (int i = 0; i < nums.length; i++) {
            if (nums[i] == 1) {
                num++;
                ans[j++] = num;
            }else{
                num = 0;
            }
        }

        //遍历生成的ans数组，找到最大值
        int max = ans[0];
        for (int i = 0; i < ans.length; i++) {
            if (ans[i] > ans[0]) {
                max = ans[i];
            }
        }
        return max;
    }
}

思路
两种遍历都是顺序遍历。
第一种是在 nums 数组不为 1 处，统计连续 1 的最大值。第二种是在 nums 数组为 1 处，统计连续 1 的最大值。
因为数组中不为 1 的个数相对少，所以在此统计，会有更少的比较次数。

